@return results Array of search results sorted by similarity
@dev Calls precompile at 0x28
Gas: ~40,000 base + 5,000/domain searched
Example:
```solidity
SearchResult[] memory matches = registry.globalSearch(
    queryEmbedding,
    10 // Top 10 results
);
```

